def histogram(test):
    """Given a string representing a space separated lowercase letters, return a dictionary
    of the letter with the most repetition and containing the corresponding count. 
    If several letters have the same occurrence, return all of them.

    Example:
    histogram('a b c') == {'a': 1, 'b': 1, 'c': 1}
    histogram('a b b a') == {'a': 2, 'b': 2}
    histogram('a b c a b') == {'a': 2, 'b': 2}
    histogram('b b b b a') == {'b': 4}
    histogram('') == {}

    """

    # Convert the string to a list of characters
    test_list = list(test)

    # Create an empty dictionary to store the letter count
    letter_count = {}

    # Loop through the list of characters and count the occurrence of each letter
    for letter in test_list:
        if letter in letter_count:
            letter_count[letter] += 1
        else:
            letter_count[letter] = 1

    # Find the letter with the most repetition
    max_count = 0
    max_letters = []
    for letter, count in letter_count.items():
        if count > max_count:
            max_count = count
            max_letters = [letter]
        elif count == max_count:
            max_letters.append(letter)

    # Create a dictionary with the letter and its count
    result = {}
    for letter in max_letters:
        result[letter] = letter_count[letter]

    return result

